(21, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"image_place\":\"end\",\"section_title\":{\"en\":\"Unlock Global Growth\",\"ar\":\"\\u0623\\u0637\\u0644\\u0642 \\u0627\\u0644\\u0639\\u0646\\u0627\\u0646 \\u0644\\u0644\\u0646\\u0645\\u0648 \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645\\u064a\"},\"section_description\":{\"en\":\"Boost revenue by selling worldwide, seamlessly. Cargo does the hard work by integrating with leading international couriers, calculating tax and duty costs and preparing the right paperwork for smooth customs clearance and delivery. Learn how Cargo handles customs clearance.\",\"ar\":\"\\u0632\\u064a\\u0627\\u062f\\u0629 \\u0627\\u0644\\u0625\\u064a\\u0631\\u0627\\u062f\\u0627\\u062a \\u0639\\u0646 \\u0637\\u0631\\u064a\\u0642 \\u0627\\u0644\\u0628\\u064a\\u0639 \\u0628\\u0633\\u0644\\u0627\\u0633\\u0629 \\u0641\\u064a \\u062c\\u0645\\u064a\\u0639 \\u0623\\u0646\\u062d\\u0627\\u0621 \\u0627\\u0644\\u0639\\u0627\\u0644\\u0645. \\u062a\\u0642\\u0648\\u0645 Cargo \\u0628\\u0627\\u0644\\u0639\\u0645\\u0644 \\u0627\\u0644\\u0634\\u0627\\u0642 \\u0645\\u0646 \\u062e\\u0644\\u0627\\u0644 \\u0627\\u0644\\u062f\\u0645\\u062c \\u0645\\u0639 \\u0634\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u0646\\u0642\\u0644 \\u0627\\u0644\\u062f\\u0648\\u0644\\u064a\\u0629 \\u0627\\u0644\\u0631\\u0627\\u0626\\u062f\\u0629 \\u060c \\u0648\\u062d\\u0633\\u0627\\u0628 \\u062a\\u0643\\u0627\\u0644\\u064a\\u0641 \\u0627\\u0644\\u0636\\u0631\\u0627\\u0626\\u0628 \\u0648\\u0627\\u0644\\u0631\\u0633\\u0648\\u0645 \\u060c \\u0648\\u0625\\u0639\\u062f\\u0627\\u062f \\u0627\\u0644\\u0623\\u0639\\u0645\\u0627\\u0644 \\u0627\\u0644\\u0648\\u0631\\u0642\\u064a\\u0629 \\u0627\\u0644\\u0645\\u0646\\u0627\\u0633\\u0628\\u0629 \\u0644\\u0644\\u062a\\u062e\\u0644\\u064a\\u0635 \\u0627\\u0644\\u062c\\u0645\\u0631\\u0643\\u064a \\u0648\\u0627\\u0644\\u062a\\u0633\\u0644\\u064a\\u0645 \\u0627\\u0644\\u0633\\u0644\\u0633. \\u062a\\u0639\\u0631\\u0641 \