(26, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"card_bg_color\":null,\"card_title_color\":null,\"section_title\":{\"en\":\"Cargo is Built for Your Business\",\"ar\":\"\\u062a\\u0645 \\u062a\\u0635\\u0645\\u064a\\u0645 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0644\\u0639\\u0645\\u0644\\u0643\"},\"section_subtitle\":{\"en\":\"We help all types of businesses manage their shipping needs.\",\"ar\":\"\\u0646\\u062d\\u0646 \\u0646\\u0633\\u0627\\u0639\\u062f \\u062c\\u0645\\u064a\\u0639 \\u0623\\u0646\\u0648\\u0627\\u0639 \\u0627\\u0644\\u0623\\u0639\\u0645\\u0627\\u0644 \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0639\\u0644\\u0649 \\u0625\\u062f\\u0627\\u0631\\u0629 \\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u062e\\u0627\\u0635\\u0629 \\u0628\\u0647\\u0645.\"},\"card_title_1\":{\"en\":\"eCommerce Brands\",\"ar\":\"\\u0645\\u0627\\u0631\\u0643\\u0627\\u062a \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u0629 \\u0627\\u0644\\u0625\\u0644\\u0643\\u062a\\u0631\\u0648\\u0646\\u064a\\u0629\"},\"card_description_1\":{\"en\":\"Whether you\'re just starting out or gaining some traction, our shipping solution is built to meet the needs of brands and customers alike.\",\"ar\":\"\\u0633\\u0648\\u0627\\u0621 \\u0643\\u0646\\u062a \\u0628\\u062f\\u0623\\u062a \\u0644\\u0644\\u062a\\u0648 \\u0623\\u0648 \\u062a\\u0643\\u062a\\u0633\\u0628 \\u0628\\u0639\\u0636 \\u0627\\u0644\\u0642\\u0648\\u0629 \\u060c \\u0641\\u0625\\u0646 \\u062d\\u0644 \\u0627\\u0644\\u0634\\u062d\\u0646 \\u0627\\u0644\\u062e\\u0627\\u0635 \\u0628\\u0646\\u0627 \\u0645\\u0635\\u0645\\u0645 \\u0644\\u062a\\u0644\\u0628\\u064a\\u0629 \\u0627\\u062d\\u062a\\u064a\\u0627\\u062c\\u0627\\u062a \\u0627\\u0644\\u0639\\u0644\\u0627\\u0645\\u0627\\u062a \\u0627\\u0644\\u062a\\u062c\\u0627\\u0631\\u064a\\u0629 \\u0648\\u0627\\u0644\\u0639\\u0645\\u0644\\u0627\\u0621 \\u0639\\u0644\\u0649 \\u062d\\u062f\\u064d