(27, 1, '{\"display\":true,\"header_bg\":null,\"title_color\":null,\"text_color\":null,\"heading_title_color\":null,\"section_title\":{\"en\":\"You\\u2019re In Good Hands\",\"ar\":\"\\u0623\\u0646\\u062a \\u0641\\u064a \\u0623\\u064a\\u062f \\u0623\\u0645\\u064a\\u0646\\u0629\"},\"section_subtitle\":{\"en\":\"We\'re happy when our customers are happy. We pride ourselves on going above and beyond.\",\"ar\":\"\\u0646\\u062d\\u0646 \\u0633\\u0639\\u062f\\u0627\\u0621 \\u0639\\u0646\\u062f\\u0645\\u0627 \\u064a\\u0643\\u0648\\u0646 \\u0639\\u0645\\u0644\\u0627\\u0624\\u0646\\u0627 \\u0633\\u0639\\u062f\\u0627\\u0621. \\u0646\\u062d\\u0646 \\u0646\\u0641\\u062e\\u0631 \\u0628\\u0623\\u0646\\u0641\\u0633\\u0646\\u0627 \\u0644\\u0623\\u0646\\u0646\\u0627 \\u0646\\u0630\\u0647\\u0628 \\u0625\\u0644\\u0649 \\u0623\\u0628\\u0639\\u062f \\u0627\\u0644\\u062d\\u062f\\u0648\\u062f.\"},\"section_heading1_title\":{\"en\":\"Get the Help You Need, 24\\/7\",\"ar\":\"\\u0627\\u062d\\u0635\\u0644 \\u0639\\u0644\\u0649 \\u0627\\u0644\\u0645\\u0633\\u0627\\u0639\\u062f\\u0629 \\u0627\\u0644\\u062a\\u064a \\u062a\\u062d\\u062a\\u0627\\u062c\\u0647\\u0627 \\u060c 24\\/7\"},\"section_heading2_title\":{\"en\":\"Become a Shipping Expert\",\"ar\":\"\\u0643\\u0646 \\u062e\\u0628\\u064a\\u0631 \\u0634\\u062d\\u0646\"},\"section_description1\":{\"en\":\"We work around the clock to get your shipments to the right place at the right time. Our support center is second-to-none.\",\"ar\":\"\\u0646\\u0639\\u0645\\u0644 \\u0639\\u0644\\u0649 \\u0645\\u062f\\u0627\\u0631 \\u0627\\u0644\\u0633\\u0627\\u0639\\u0629 \\u0644\\u062a\\u0648\\u0635\\u064a\\u0644 \\u0634\\u062d\\u0646\\u0627\\u062a\\u0643 \\u0625\\u0644\\u0649 \\u0627\\u0644\\u0645\\u0643\\u0627\\u0646 \\u0627\\u0644\\u0645\\u0646\\u0627\\u0633\\u0628 \\u0641\\u064a \\u0627\\u0644\\u0648\\u0642\\u062a \\u0627\\u0644\\u0645\\u0646\\u0627\\u0633\\u0628. \\u0645\\u0631\\u0643\\u0632 \\u0627\\u0644\\u062f\\u0639\\u0645 \\u0627\\u0644\\u062e\\u0627\\